import {makeStyles} from "@material-ui/core/styles";
import React from 'react';
import Introduction from './Introduction';

const useStyles = makeStyles ((theme) => ({
    grid: {
      width: '100%',
      margin: '0px',
    },

  }));

function LeftContainer({component,info}){
    return(
        <Grid container sx = "3" lg = "8" md = "6"  direction="column-reverse" justify="flex-start" alignItems="flex-start">
        <div style = {{marginLeft: 76}} > 
            <Grid item>
              <Introduction name = {info.name} description = {info.description}/>
            </Grid> 
        </div>
      </Grid>
    );

}

export default LeftContainer;
